import React from 'react';
import { useNavigate } from 'react-router-dom';
import useProfileStore from '../../store/profileStore';
import useCreateTeams from '../../hooks/useCreateTeams';
import './ProfilePage.css';

const ProfilePage = () => {
  const navigate = useNavigate();
  const { extractedProfiles, isCreatingTeams } = useProfileStore();
  const { createTeams } = useCreateTeams();

  return (
    <div className="profile-page">
      <div className="page-header">
        <div className="header-content">
          <button 
            onClick={() => navigate('/')} 
            className="back-button"
          >
            <span className="button-icon">‚Üê</span> Back to Home
          </button>
          <h1 className="page-title">Researcher Profiles</h1>
          <div className="profile-count">
            {extractedProfiles.length} {extractedProfiles.length === 1 ? 'Profile' : 'Profiles'}
          </div>
        </div>
      </div>

      <main className="page-content">
        {extractedProfiles.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">
              <span role="img" aria-label="Researcher">üßë‚Äçüî¨</span>
            </div>
            <h2>No Profiles Available</h2>
            <p className="empty-message">
              Submit researcher profiles from the homepage to get started
            </p>
            <button 
              onClick={() => navigate('/')} 
              className="primary-button"
            >
              Go to Homepage
            </button>
          </div>
        ) : (
          <>
            <div className="profiles-grid">
              {extractedProfiles.map((profile, index) => (
                <div key={index} className="profile-card">
                  <div className="card-header">
                    <h2 className="researcher-name">{profile.name}</h2>
                    {profile.affiliation && (
                      <p className="affiliation">
                        <span className="icon">üèõÔ∏è</span> {profile.affiliation}
                      </p>
                    )}
                  </div>

                  <div className="card-body">
                    <div className="research-section">
                      <h3 className="section-title">
                        <span className="icon">üî¨</span> Research Topics
                      </h3>
                      {profile.research_topics?.length > 0 ? (
                        <div className="topics-container">
                          {profile.research_topics.map((topic, idx) => (
                            <span key={idx} className="topic-tag">{topic}</span>
                          ))}
                        </div>
                      ) : (
                        <p className="no-topics">No research topics extracted</p>
                      )}
                    </div>
                  </div>
                </div>
              ))}
            </div>

            <div className="action-section">
              <button
                onClick={createTeams}
                disabled={isCreatingTeams || extractedProfiles.length === 0}
                className="create-teams-button"
              >
                {isCreatingTeams ? (
                  <>
                    <div className="loading-spinner"></div>
                    Generating Teams...
                  </>
                ) : (
                  <>
                    <span className="icon">üë•</span> Create Research Teams
                  </>
                )}
              </button>
              <p className="action-hint">
                We'll analyze research topics to form optimal interdisciplinary teams
              </p>
            </div>
          </>
        )}
      </main>
    </div>
  );
};

export default ProfilePage;
